const AVATAR = 'AVATAR'
const SET_CHOSEN_AVATAR = 'SET_CHOSEN_AVATAR'

const initialState = {
  chosenAvatar: '',
  listOfAvatars: [
    {
      src: 'data:image/png;base64,',
      alt: 'sonic the hedgehog'
    },
    {
      src: 'data:image/png;base64,',
      alt: 'frog'
    },
    {
      src: 'data:image/png;base64,',
      alt: 'Neytiri from Avatar'
    },
    {
      src: 'data:image/png;base64,',
      alt: 'cute dragon'
    },
    {
      src: 'data:image/png;base64,',
      alt: 'black man with dark hair'
    },
    {
      src: 'data:image/png;base64,',
      alt: 'red-haired woman'
    },
    {
      src: 'data:image/png;base64,',
      alt: 'curly-headed woman'
    },
    {
      src: 'data:image/png;base64,',
      alt: 'fair hair man'
    },
    {
      src: 'data:image/png;base64,',
      alt: 'man in suit'
    }
  ]
}

export default (state = initialState, action) => {
  switch (action.type) {
    case AVATAR: {
      return { ...state, listOfAvatars: action.listOfAvatars }
    }
    case SET_CHOSEN_AVATAR: {
      return { ...state, chosenAvatar: action.chosenAvatar }
    }
    default:
      return state
  }
}

export function setChosenAvatar(selectedAva) {
  return (dispatch) => {
    const chosenAvatar = selectedAva
    dispatch({
      type: SET_CHOSEN_AVATAR,
      chosenAvatar
    })
  }
}
